import React from 'react';


class SignUpPage extends React.Component{
    constructor(props) {
        super(props)

        this.state= {
            firstName: '',
            lastName: '',
            password: '',
            gender: '',
        }
        this.handleSubmit = this.handleSubmit.bind(this)
    }
    firsthandler = (event) => {
        this.setState({
            firstName: event.target.value
        })
    }
    lasthandler = (event) => {
        this.setState({
            lastName: event.target.value
        })
    }
    passwordhandler = (event) => {
        this.setState({
            password:event.target.value
        })
    }
    genderhandler = (event) => {
        this.setState({
            gender: event.target.value
        })
    }
    handleSubmit= (event) => {
        alert(`${this.state.firstName} ${this.state.lastName} Registered Sucessfully`)
        console.log(this.state);
        this.setState({
            firstName: "",
            lastName: '',
            password: '',
            gender: '',
        })
        event.preventDefault()
    }
}

export default SignUpPage
